import React from 'react';
import {HomePage} from "pages"
import {Layout} from "components/common"
import ThemeProvider from "providers/ThemeProvider"
function App() {
  return (
    <div className="App">
      <ThemeProvider>
        <Layout>
          <HomePage />
        </Layout>
      </ThemeProvider>

    </div>
  );
}

export default App;
